@POTUS We don't need leadership we need representatives. 
The chef representative of the will of all the people is the presidency. 
A president who represents the intrest of the debt stakeholders isn't a president of the people but a fiat mafia puppet building China infrastructure.

@PrisonPlanet Climate reparations is about keeping the global south on dollar plantation system. 

Restricting oil consumption is a scheme to deleverage the Petrodollar. A high ratio of petrol to eurodollars helps keep the financial ponzi solvent.

China has opted out of the scheme altogether.
